import styled, { css } from 'styled-components';

export const Input = styled.input`
  height: 30px;
  outline: none;
  border-radius: 4px
  padding: 0 10px;
  min-width: 200px;
  border: 1px solid rgba(224, 224, 224, 1);
`;
